// import logo from './logo.svg';
import './App.css';
// import './normalize.css'
import Wall from './Components/Wall/Wall';
import { BrowserRouter as Router , Routes, Route} from 'react-router-dom';


function App() {
  return (
    <Router>
      <Routes>
        <Route path='' Component={<Wall/>} ></Route>
      </Routes>
    </Router> 
  );
}

export default App;
